INSERT INTO `nagios_command` VALUES (49,'dns_status','$USER1$/check_dns -H $ARG1$ -s $ARG2$ -a $ARG3$','check the response time of a DNS server'),(50,'check_ftp','$USER1$/check_ftp -H $HOSTADDRESS$','check if the ftp port is opened (21)'),(51,'check_hpjd','$USER1$/check_hpjd -H $HOSTADDRESS$ -C $USER2$','check the state of a HP JetDirec printer'),(52,'check_local_disk','$USER1$/check_disk -w $ARG1$ -c $ARG2$ -p $ARG3$','check the used space on a locale linux machine'),(53,'check_local_load','$USER1$/check_load -w $ARG1$ -c $ARG2$','check the load average on a local linux machine'),(54,'check_local_procs','$USER1$/check_procs -w $ARG1$ -c $ARG2$ -s $ARG3$','check the state of a running process on local linux host'),(55,'check_local_users','$USER1$/check_users -w $ARG1$ -c $ARG2$','check the number of connected users on the local linux machine'),(56,'check_nntp','$USER1$/check_nntp -H $HOSTADDRESS$','check NNTP connections on a given host'),(57,'check_ping','$USER1$/check_ping -H $ARG3$ -w $ARG1$ -c $ARG2$ -p 1','check the ICMP availability of a given device - ARG3= IPadressHost'),(58,'check_tcp','$USER1$/check_tcp -H $HOSTADDRESS$ -p $ARG1$','check the openning of a given tcp port'),(59,'check_telnet','$USER1$/check_tcp -H $HOSTADDRESS$ -p 23','check the openning of the telnet port (23)'),(60,'check_udp','$USER1$/check_udp -H $HOSTADDRESS$ -p $ARG1$','check the openning of a given udp port'),(61,'check-host-alive','$USER1$/check_ping -H $HOSTADDRESS$ -w 3000.0,80% -c 5000.0,100% -p 1','check the availability of a host by ping'),(62,'notify-by-email-host','/usr/bin/printf \"%b\" \"***** Nagios  *****\\\\n\\\\nNotification Type: $NOTIFICATIONTYPE$\\\\nHost: $HOSTNAME$\\\\nState: $HOSTSTATE$\\\\nAddress: $HOSTADDRESS$\\\\nInfo: $HOSTOUTPUT$\\\\n\\\\nDate/Time: $LONGDATETIME$\\\\n\" | /bin/mail -s \"Host $HOSTSTATE$ alert for $HOSTNAME$!\" $CONTACTEMAIL$','notification mail hosts'),(63,'host-notify-by-epager','/usr/bin/printf \"%b\" \"Host \\\'$HOSTALIAS$\\\' is $HOSTSTA